-- ----------------------------
-- Table structure for custom_calendar_event
-- ----------------------------
DROP TABLE IF EXISTS `custom_calendar_event`;
CREATE TABLE `custom_calendar_event` (
  `createdate` bigint(20) DEFAULT NULL,
  `createuser` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createip` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `updatedate` bigint(20) DEFAULT NULL,
  `updateuser` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `updateip` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `sid` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `parent_sid` bigint(20) DEFAULT NULL COMMENT '截斷了哪個行事曆',
  `start_date` datetime NOT NULL COMMENT '開始時間日期',
  `end_date` datetime NOT NULL COMMENT '結束時間日期',
  `repeat_stop` datetime DEFAULT NULL COMMENT '重複到什麼時候停止 (與repeat_times互斥)',
  `repeat_times` int(11) DEFAULT NULL COMMENT '重複幾次停止 權重大於 repeat_stop',
  `repeat_gap` int(11) DEFAULT NULL COMMENT '重複的間隔 (頻率)',
  `repeat_type` enum('type_day','type_week','type_month') COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '重複的方式 (day,week,month)',
  `repeat_value` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '重複的內容，依據repeat_type有不同的意義，when repeat_type == week -> 1~7，when repeat_type == month -> 1~31',
  `title` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '行程的標題',
  `color` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'fullCalendar的color',
  `sequence` int(10) unsigned DEFAULT NULL,
  `lan` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `use_table_sid` int(11) DEFAULT NULL COMMENT '對應custom_calender_use_table的sid',
  `allDay` tinyint(1) DEFAULT NULL COMMENT '是否為全天 (如果是的話，前台會無視時間直接設定為全天)',
  PRIMARY KEY (`sid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='行事曆-事件，跟custom_calender有關聯，重複事件的排定方式';

-- ----------------------------
-- Table structure for custom_calendar_use_table
-- ----------------------------
DROP TABLE IF EXISTS `custom_calendar_use_table`;
CREATE TABLE `custom_calendar_use_table` (
  `createdate` bigint(20) DEFAULT NULL,
  `createuser` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createip` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `updatedate` bigint(20) DEFAULT NULL,
  `updateuser` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `updateip` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `sid` int(20) unsigned NOT NULL AUTO_INCREMENT,
  `sequence` int(10) unsigned DEFAULT NULL,
  `lan` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `table_name` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '使用行事曆的功能名稱 (不一定要table_name反正就用這個值去判斷誰用)',
  `used_sid` bigint(20) DEFAULT NULL COMMENT '使用行事曆的sid',
  PRIMARY KEY (`sid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='行事曆-table，開放給其他功能使用行事曆，所以有多一張custom_calender_use_table，記錄是哪個功能來使用行事曆';

