-- ----------------------------
-- Table structure for sys_files_store
-- ----------------------------
DROP TABLE IF EXISTS `sys_files_store`;
CREATE TABLE `sys_files_store` (
  `createdate` bigint(20) DEFAULT NULL,
  `createuser` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `createip` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `updatedate` bigint(20) DEFAULT NULL,
  `updateuser` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `updateip` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `sid` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `sequence` int(10) unsigned DEFAULT '0',
  `lan` varchar(10) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL COMMENT '檔案實際存在server內的名稱',
  `file_ext` varchar(16) DEFAULT NULL COMMENT '副檔名',
  `size` bigint(20) unsigned DEFAULT NULL COMMENT '為檔案大小，單位為Byte',
  `file_hash` char(32) DEFAULT NULL COMMENT '檔案的 hash，使用 MD5',
  `file_path` varchar(255) DEFAULT NULL COMMENT '檔案實際儲存路徑',
  `remark` text COMMENT '被哪個功能認領了 (只是用來記錄，未來要刪除不必要檔案時，方便尋找還有沒有人要使用這個檔案)',
  `upload_token` char(32) DEFAULT NULL COMMENT '這個上傳的檔案屬於誰的 (用一個token標記，等使用者真的按下確認後，才是真的確認上傳並儲存)',
  `sigh` enum('save','temporary','same') DEFAULT NULL COMMENT '此檔案是甚麼狀態 (’save’=已按下確認儲存,’temporary’=未按下確認儲存,’same’=有人上傳過一模一樣的檔案並儲存，不能隨意刪除)',
  `action_sigh` enum('save','delete') DEFAULT NULL COMMENT '標記預計要做的動作 (檔案上傳後雖然已經在server內，但只有在使用者確認儲存後才會實際關聯需要的表or刪掉他) (’save’=儲存,’delete’=刪除)',
  `upload_from` varchar(16) DEFAULT NULL COMMENT '可以分辨從前台上傳還是後台上傳',
  PRIMARY KEY (`sid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='將上傳後的檔案集中管理，有需要的功能可以自己開表關聯這張表。也為了未來將檔案集中管理，例如A和B兩個使用者上傳一模一樣的檔案，那就可以只存留一份檔案，然後用關聯表把他關聯起來。';

